import React from "react";
import "./Welcome.css";

import "bootstrap/dist/css/bootstrap.css";
const Welcome = () => {
  return (
    <div className="card__style">
      <br />
      <br />
      <br />
      <h1 className="title__text">
        Find
        <br />
        Love
      </h1>
      </div>
  );
};

export default Welcome;
